	public double modelOutput(double e1, double e5) {
		
		double activationSum = ruleActivation(1, e1, e5)
				+ ruleActivation(2, e1, e5)
				+ ruleActivation(3, e1, e5)
				+ ruleActivation(4, e1, e5)
				+ ruleActivation(5, e1, e5);
		
		double weightedOutput = ruleActivation(1, e1, e5)*rule(1, e1, e5) 
				+ ruleActivation(2, e1, e5)*rule(2, e1, e5) 
				+ ruleActivation(3, e1, e5)*rule(3, e1, e5) 
				+ ruleActivation(4, e1, e5)*rule(4, e1, e5)
				+ ruleActivation(5, e1, e5)*rule(5, e1, e5);
		
		return weightedOutput/activationSum;
	}
	
	//RULES
	//Pertenencia
	public double pertenencia(double a, double b, double x) {
		return Math.exp(-0.5*(a*(x - b))*(a*(x - b)));
	}
		
	//activation(rule, e1, e5)
	public double ruleActivation(int i, double e1, double e5) {
		//PERTENENCIA1
		double inputActivation1 = pertenencia(aValue(i,1),bValue(i,1),e1);
		//PERTENENCIA2
		double inputActivation2 = pertenencia(aValue(i,2),bValue(i,2),e5);
		//RULE ACTIVATION
		//System.out.println("A1 : " + inputActivation1 + ", A2 : " + inputActivation2);
		return inputActivation1*inputActivation2;
	}
	
	public double rule(int i, double e1, double e5) {
		return gValue(i,2)*e1 + gValue(i,3)*e5 + gValue(i,1); //Ac√° estaba la cola del diablo
	}
	
	//VALUE GETTERS
	public double aValue(int i, int j) {
		return a[i-1][j-1];
	}
	
	public double [][] getA() {
		return a;
	}
	
	public double bValue(int i, int j) {
		return b[i-1][j-1];
	}
	
	public double [][] getB() {
		return b;
	}
	
	public double gValue(int i, int j) {
		return g[i-1][j-1];
	}
	
	public double [][] getG() {
		return g;
	}
	
	public double hValue(int i, int j) {
		return h[i-1][j-1];
	}
	
	public double [][] getH() {
		return h;
	}
	
	public double PValue(int i, int j, int k) {
		return P[i-1][j-1][k-1];
	}
	
	public double [][][] getP() {
		return P;
	}
	
	public double getMu() {
		return mu;
	}
	
	public double getStd() {
		return std;
	}
	
	public double[] getSigma() {
		return sigma;
	}
	
